import React from "react";
import MobileViewInfo from "common/components/MobileViewInfo";
import { BrowserView, MobileOnlyView } from "react-device-detect";
import { SocketManager } from "modules/square/components/SocketManager";
import CanvasExample from "modules/square/components/CanvasExample";

const Square = () => {
  return (
    <>
      <BrowserView>
        <SocketManager />
        <div style={{ position: "relative", width: 800, height: 600 }}>
          <CanvasExample />
        </div>
      </BrowserView>
      <MobileOnlyView>
        <MobileViewInfo />
      </MobileOnlyView>
    </>
  );
};

export default Square;
